import React from 'react'; 

function PizzaCard(props, setOrdere) {
  return (
    <div className="col-md-3 mb-5" key={`${props.id}`}>
      <div className="card" style={{width:"300px"}}>
          <img className="card-img-top" src={props.image} style={{width:"auto",height:"250px"}} alt="Card image" />
          <div className="card-body">
              <h4 className="card-title">{props.name}</h4>
              <p className="card-text">{props.desc}</p>
              <a href="#" className="btn btn-primary">{props.price}</a>
          </div>
      </div>
    </div>
  )
}

export default PizzaCard;
